import React, { Component } from 'react';

class ListDestino extends Component {
    constructor(props) {
        super(props)

        this.state = {
            destinos: []

        }
    }

    render() {
        return (
            <div>
                |<h2> Lista de Destinos Adicionados</h2>
                <div className="row">
                    <table className='table table-striped table-bordered'>
                        <thead>
                            <tr>
                                <th> Origem </th>
                                <th> Destino </th>
                            </tr>
                        </thead>

                        <tbody>
                            {
                                this.state.destinos.map(
                                    destino =>
                                        <tr key={destino.id}>
                                            <td> {destino.origem}</td>
                                            <td> {destino.destino}</td>
                                        </tr>
                                )
                            }
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}

export default ListDestino;
